const Option1 = () => <Text>Opción 1</Text>;
const Option2 = () => <Text>Opción 1</Text>;
const Menu = () => <Text>Menu</Text>;


const Main = ()=>{

    return(
        <NativeRouter>
        <View>


          <Routes>
            <Route path="/" element={<Option2 />} />
            <Route path="/sing-in" element={<Option1 />} />
          </Routes>
        </View>
      </NativeRouter>



    )
}
